  false,\n\t\"url\": null,\n\t\"notes\": \"This summary describes the results obtained
  from a temperature gradient survey of the San Emidio wells drilled in Washoe County,
  Nevada.  The temperature gradient survey was performed during the month of July,
  1976, by Geonomics, Inc., for the Chevron Oil Company. The approximate location
  of the survey is shown in Figure 1.  A total of two holes were drilled (S.E. #A
  and S.E. #B) with locations plotted on Figure 2.\",\n\t\"license_title\": null,\n\t\"extras\":
